import React, { useState } from "react";
import "./Search.css"; // 引入样式文件

export default function Search() {
    // 状态管理搜索条件
    const [searchCriteria, setSearchCriteria] = useState({
        make: "",
        model: "",
        year: "",
        states: "",
        car_condition: "",
        sales_category: "",
        body_type: "",
        fuel_type: "",
    });

    // 处理输入框变化
    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setSearchCriteria({
            ...searchCriteria,
            [name]: value,
        });
    };

    // 处理表单提交
    const handleSubmit = (e) => {
        e.preventDefault();
        console.log("搜索条件:", searchCriteria);
        // 在这里可以调用 API 或执行搜索逻辑
    };

    return (
        <div className="search-container">
            <h2>车辆搜索</h2>
            <form onSubmit={handleSubmit}>
                <div className="search-fields">
                    {/* 每行 4 个搜索框 */}
                    <div className="search-row">
                        <div className="search-field">
                            <label>品牌</label>
                            <input
                                type="text"
                                name="make"
                                value={searchCriteria.make}
                                onChange={handleInputChange}
                                placeholder="例如: Audi"
                            />
                        </div>
                        <div className="search-field">
                            <label>型号</label>
                            <input
                                type="text"
                                name="model"
                                value={searchCriteria.model}
                                onChange={handleInputChange}
                                placeholder="例如: A5"
                            />
                        </div>
                        <div className="search-field">
                            <label>年份</label>
                            <input
                                type="number"
                                name="year"
                                value={searchCriteria.year}
                                onChange={handleInputChange}
                                placeholder="例如: 2015"
                            />
                        </div>
                        <div className="search-field">
                            <label>州/地区</label>
                            <input
                                type="text"
                                name="states"
                                value={searchCriteria.states}
                                onChange={handleInputChange}
                                placeholder="例如: California"
                            />
                        </div>
                    </div>

                    <div className="search-row">
                        <div className="search-field">
                            <label>车况</label>
                            <input
                                type="text"
                                name="car_condition"
                                value={searchCriteria.car_condition}
                                onChange={handleInputChange}
                                placeholder="例如: Used"
                            />
                        </div>
                        <div className="search-field">
                            <label>销售类别</label>
                            <input
                                type="text"
                                name="sales_category"
                                value={searchCriteria.sales_category}
                                onChange={handleInputChange}
                                placeholder="例如: Private"
                            />
                        </div>
                        <div className="search-field">
                            <label>车身类型</label>
                            <input
                                type="text"
                                name="body_type"
                                value={searchCriteria.body_type}
                                onChange={handleInputChange}
                                placeholder="例如: Sportback"
                            />
                        </div>
                        <div className="search-field">
                            <label>燃油类型</label>
                            <input
                                type="text"
                                name="fuel_type"
                                value={searchCriteria.fuel_type}
                                onChange={handleInputChange}
                                placeholder="例如: Diesel"
                            />
                        </div>
                    </div>
                </div>

                {/* 搜索按钮 */}
                <button type="submit" className="search-button">
                    搜索
                </button>
            </form>
        </div>
    );
}
